From there, a fellow teacher of the online @artsummits with me - @sarahdandelioncray reached out to me about a company she started called @letsgomakeart and asked me to come check it out in Missouri. I said why the heck not, met her, felt a connection, and said yes to teaching lettering with them. I can’t believe it’s now been 4 years! 

@sarahdandelioncray, @michaelcray4, and their kids have become family now and I’m so grateful for them 🤍

@golden.coil said to create a design you would want to be on a planner you purchase, so here is mine :) 

A mix of watercolor florals and a reminder to be gentle with yourself.

I’m entering the @golden.coil design contest and would be honored to be chosen amongst their other beautiful artists! #GCxDESIGN23
